import React from "react";

export default function About() {
  return (
    <div className="about">
      <h3 className="about--title">About</h3>
      <p className="about--paragraph">
      I'm an Information Technology undergrad proficient in logical thinking and problem-solving skills. 
      Eager to learn new technologies and keen to contribute to the growth of society. 
      I'm also a team player with good interpersonal and communication skills.
      </p>
    </div>
  );
}
